import React from 'react';
import Landing from "views/Lading.js";


class App extends React.Component {
  constructor(){
    super();
    this.state = {
      users: [], 
      searchText : ''
    }
}


//   //will render again after first render of mounting due to the setstate
componentDidMount(){
    fetch("https://community-open-weather-map.p.rapidapi.com/weather", {
        "method": "GET",
        "headers": {
            "x-rapidapi-host": "community-open-weather-map.p.rapidapi.com",
            "x-rapidapi-key": "6247ee2359msh26e18b6731a15e8p1fda3djsnbba52788c41c"
        }
    })
    .then(response => {
        console.log(response);
    })
    .catch(err => {
        console.log(err);
    });
}


  render() {
    return (
        <div>
            <Landing />
        </div>
  )
}


}
export default App;
